  01> DRUMMOND, Sallie Elizabeth m on 20.04.1968 to MOORE, Peter Winston
  Gifford
  b 04.08.1946
  b 16.02.1942
  Sallie b. at Hastings and m. at St Mary's Church, Waipukurau. Peter, s/o Gordon Melville Gifford
  (John) Moore and Joan Susan Gaisford, b. at Palmerston North. 3 Redwood Place, Te Awanga.
  Sallie was a Nutri-Metics district director and then sales manager with the Sun newspaper. She is
  now area manager for Michad Linen. Peter was a taxi driver and is now a courier driver.
  01> MOORE, Tony Peter Gifford
  b 01.04.1970
