  Betty Green, b. at Waipawa. Address: 12 Napier Terrace, Napier.
  Kay is a claims supervisor with NZI Insurance in Napier and David is an auto electrician in
  Hastings.
  01> STAINES, Rachael Frances
  b 04.07.1970
