  01> WILLIAMS, Keith Colgate m on 05.07.1947 to GRAHAM, Lesley May
  b 05.11.1922
  b 23.03.1925
  Keith b. at Palmerston North and m, at All Saints Church, Palmerston North.
  Lesley, d/o John Graham and Dorothy Isabella Hamerton, b. at Taihape. The
  Hamerton family trace their pedigree back to Richard de Hamerton living in
  1170 at Hamerton near Staidburn in Yorkshire. For 19 generations a family
  member held the title of Lord of the Manor of Hellifield. Address: PO Box 563,
  Honiara, Solomon Islands.
  Keith was educated at Palmerston North and at Wanganui Collegiate School (1937-39). He worked briefly
  at agricultural contracting then enlisted in the Army in 1940 serving in the 5th Field Regiment
  Artillery in the Middle East and Italy. Back in New Zealand he was again working at contracting then
  bought out his employer and developed the business into logging contracting in the Rangitaiki area. In
  1956 he obtained a position as a logging supervisor with Benguet Consolidated, a large American gold
